function plot_u_grid(task, err, t, hx, ht, y)

	l = 1;

	plot_x = 101;
	plot_y = 101;
	plot_hx = l / (plot_x - 1);
	plot_ht = t / (plot_y - 1);
	
	xr = 0.0 : hx : l;
	yr = 0.0 : ht : t;

	meshX = linspace(0, l, plot_x);
	disp(size(meshX));
	meshY = linspace(0, t, plot_y);
	disp(size(meshY));
	meshZ = zeros(plot_y, plot_x);
	
	disp(size(xr));
	disp(size(yr));

	for i = 1 : plot_y
		meshZ(i, :) = interp2(xr, yr, y, 0.0 : plot_hx : l, (i - 1) * plot_ht, "spline");
	end


	mesh(meshX, meshY, meshZ);
	%legend(sprintf("E(T) = %e", err));
	xlabel 'X-axis';
	ylabel 'T-axis';
	zlabel 'U-axis';
	title ('U(x, t)');
	print(sprintf("images/task %d u(x, t) t %f.png", task, t), "-S800, 600");
endfunction

